# <codecell>

def avg (lst):
    sumlist=0
    for i in lst:
        sumlist=sumlist+i
    return float(sumlist)/len(lst)

# <codecell>

def approximation (lst,w): #list,window(int)
    a=[avg(lst[i-w/2:i+w/2]) for i in range(w/2,len(lst)-w/2)]
    newlist=[lst[i] for i in range(w/2)]
    newlist=newlist+a
    newlist=newlist+[lst[i] for i in range(len(lst)-w/2,len(lst))]
    return newlist

# <codecell>

def get_k1k2(lowerLimit,upperLimit,numslist,wattslist,spdlist,f1list,f4list,rolist):
    a=[0.5*rolist[i]*spdlist[i]**2 for i in numslist[lowerLimit:upperLimit]]
    b=[1 for i in numslist[lowerLimit:upperLimit]]
    c=[]
    for i in numslist[lowerLimit:upperLimit]:
        if spdlist[i]==0:
            c.append(0)
        else:
            c.append(wattslist[i]/spdlist[i]-(f1list[i]+f4list[i]))
    #~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    sa=0
    sb=0
    sc=0
    sd=0
    for i in numslist[:upperLimit-lowerLimit]:
        sa=sa+a[i]**2
        sb=sb+a[i]*b[i]
        sc=sb
        sd=sd+b[i]**2
    #~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    num1=sd/(sa*sd-sb*sc)
    num2=-sb/(sa*sd-sb*sc)
    num3=-sc/(sa*sd-sb*sc)
    num4=sa/(sa*sd-sb*sc)
    #~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    v1=[num1*a[i]+num2*b[i] for i in numslist[:upperLimit-lowerLimit]]
    v2=[num3*a[i]+num4*b[i] for i in numslist[:upperLimit-lowerLimit]]
    #~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    k1=0
    k2=0
    for i in numslist[:upperLimit-lowerLimit]:
        k1=k1+v1[i]*c[i]
        k2=k2+v2[i]*c[i]
    #~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    return k1,k2
    

# <codecell>

def check (xlist,ylist):
    sumlist=0
    averagex=avg(xlist)
    averagey=avg(ylist)
    mone=0
    mehanex=0
    mehaney=0
    for i in range(len(xlist)):
        mone=mone+(xlist[i]-averagex)*(ylist[i]-averagey)
    for i in range(len(xlist)):
        mehanex=mehanex+(xlist[i]-averagex)**2
        mehaney=mehaney+(ylist[i]-averagey)**2
    mehane=sqrt(mehanex*mehaney)
    return float(mone)/mehane

