# <codecell>

def get_incline(altlist,distlist):
    incline=[0]
    for i in range(1,len(altlist)):
        dalt=altlist[i]-altlist[i-1]
        ddist=distlist[i]-distlist[i-1]
        if ddist==0:
            incline.append(0)
        else:
            incline.append(dalt/ddist)
    return incline

# <codecell>

def get_f1(m,g,inclinelist,numslist):
    f1=[m*g*inclinelist[i] for i in numslist]
    return f1

# <codecell>

def get_acceleration(spdlist):
    acceleration=[(spdlist[i+1]-spdlist[i-1])/2 for i in range(1,len(spdlist)-1)]
    for i in range(2):
        acceleration.append(0)
    return acceleration

# <codecell>

def get_f4(accelerationlist,m):
    f4=[accelerationlist[i]*m for i in range(len(accelerationlist))]
    return f4

# <codecell>

def get_pressure(altlist):
    p0=101325
    l=0.0065
    t0=288.15
    g=9.80665
    m=0.0289644
    r=8.31447
    p=[p0*(1-l*h/t0)**((g*m)/(r*l)) for h in altlist]
    return p

# <codecell>

def get_ro(t,altlist): #kelvin
    rSpecific=287.058
    ro=[i/(rSpecific*t) for i in get_pressure(altlist)]
    return ro

# <codecell>

def get_f2f3(rolist,spdlist,numslist,k1,k2):
    f2=[0.5*rolist[i]*spdlist[i]**2*k1 for i in numslist]
    f3=k2
    return f2,f3

# <codecell>

def get_mywatts(f1list,f2list,f3,f4list,spdlist,numslist):
    mywatts=[(f1list[i]+f2list[i]+f3+f4list[i])*spdlist[i] for i in numslist]
    return mywatts

