    avgwatts=approximation(wattslist,limits)
    altitude=approximation(altlist,limits)
    incline=get_incline(altitude,distlist)
    f1=get_f1(m,9.8,incline,numslist)
    ro=get_ro(295.15,altitude)
    f2,f3=get_f2f3(ro,spdlist,numslist,k1,k2)
    acceleration=get_acceleration(spdlist)
    f4=get_f4(acceleration,m)
    mywatts=get_mywatts(f1,f2,f3,f4,spdlist,numslist)
    avgmywatts=approximation(mywatts,limits)
    k=0
